/* eslint-disable jsx-a11y/anchor-has-content */
import React from 'react';
import { Routes,Route} from 'react-router-dom';
import { adminRoutes } from './routes';

function App() {
    return (
        <div className="App">
            <h1>我是APP组件</h1>
            <Routes>
                {adminRoutes.map(route=>{
                    return (
                        <Route 
                        key={route.path} 
                        path={route.path} 
                        exact={route.exact} 
                        render={routeProps=>{
                            return <route.component {...routeProps}/>;
                        }}/>
                    );
                })}
            </Routes>
        </div>
    )
}

export default App
